var get_observation = function (fhir, obs_id)
{
   return fhir['contained'].find(function (obs) { return obs.id == obs_id });
}

// solves all NS issues!
default xml namespace = "http://schemas.openehr.org/v1";

// access analyte result CLUSTER from outbound template
var analyte_cluster = tmp['version']['data']['content']['data']['events']['data']['items'][4];

// TODO: to be more generic generate the number of observations-1 that come on the inbound message
// generates 3 more analyte structures from the one on the template
for (var i = 1; i <= 3; i++)
{
   // to add a sibling of the analyte, the object to call "insert" on
   // should be the parent of the sibling to be added, and it's the
   // parent of the node to add the sibling after it
   analyte_cluster.parent().insertChildAfter(analyte_cluster, analyte_cluster.copy());

}

