var result_id, observation, analyte_idx = 0;
for each (res in msg['result'])
{
   result_id = res.reference.toString().substring(1);

   observation = get_observation(msg, result_id);

/*
   logger.info(observation.code.coding[0].code.toString()); // LOINC CODE
   logger.info(observation.code.coding[0].display.toString()); // LOINC NAME
   logger.info(observation.code.text.toString()); // ANALYTE NAME
   logger.info(observation.valueQuantity.value.toString()); // ANALYTE RESULT QTY VALUE
   logger.info(observation.valueQuantity.unit.toString()); // ANALYTE RESULT QTY UNITs
*/

   // ANALYTE NAME
   tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['name']['value'] = observation.code.text.toString();

   // LOINC NAME, CODE
   tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][0]['value']['value'] = observation.code.coding[0].display.toString();
   tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][0]['value']['defining_code']['code_string'] = observation.code.coding[0].code.toString();

   // ANALYTE RESULT QTY VALUE, UNITS
   tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][1]['value']['magnitude'] = observation.valueQuantity.value.toString();
   tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][1]['value']['units'] = observation.valueQuantity.unit.toString();

   // TODO: map Analyte result status timestamp (openEHR)
   // TODO: map msg['contained'][0]['referenceRange'] to DV_QUANTITY.normal_range

   // mapping OBservationStatus FHIR values to openEHR local analyte status values
   // https://www.hl7.org/fhir/valueset-observation-status.html
   switch (msg['contained'][analyte_idx]['status'].toString())
   {
      case 'final':
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['defining_code']['code_string'] = 'at0018';
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['value'] = 'Final';
      break;
      case 'registered':
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['defining_code']['code_string'] = 'at0015';
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['value'] = 'Registered';
      break;
      case 'preliminary':
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['defining_code']['code_string'] = 'at0017';
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['value'] = 'Preliminary';
      break;
      case 'cancelled':
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['defining_code']['code_string'] = 'at0023';
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['value'] = 'Cancelled';
      break;
      case 'amended':
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['defining_code']['code_string'] = 'at0020';
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['value'] = 'Amended';
      break;
      case 'corrected':
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['defining_code']['code_string'] = 'at0019';
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['value'] = 'Corrected';
      break;
      default:
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['defining_code']['code_string'] = 'at0018';
         tmp['version']['data']['content']['data']['events']['data']['items'][4+analyte_idx]['items'][2]['value']['value'] = 'Final';
   }

   analyte_idx++;
}

